 FILE_ACCESS_FAILURE=2, OTHER_FAILURE };\n\nconst vector<CppAD::AD<double> > wres( int n,\n                                       const valarray<double> & Ri,\n                                       const vector  < CppAD::AD<double> > & residual )\n{\n   assert( Ri.size() == n * n );\n   assert( residual.size() == n );\n   valarray<double> r( n );\n   for( int i=0; i<n; i++ ) r[i] = CppAD::Value( residual[i] );\n   valarray<double> C( 0.0, n * n );\n   C = cholesky( Ri, n );\n   valarray<double> w = multiply( C, n, r, 1 );\n   vector< CppAD::AD<double> > Cr(n);\n   for( int i=0; i<n; i++ ) Cr[i] = w[i];\n   return Cr;\n}\n\nint main( int argc, const char argv[] )\n{\n/*******************************************************************/\n/*                                                                 */\n/*   Set up                                                        */\n/*                                                                 */\n/*******************************************************************/\nofstream oRuntimeError( \"spk_error.tmp\" );\nif( !oRuntimeError.good() )\n  {\n      fprintf( stderr, \"%s:%d: Failed to create a temporary file, %s.\",  __FILE__, __LINE__, \"spk_error.tmp\" );\n      return FILE_ACCESS_FAILURE;\n  }\n\n//FpErrorChecker fperror;\n\nconst int nY = 236;\nDataSet< CppAD::AD<double> > set;\n\nconst bool isSimRequested = false;\nbool haveCompleteData = true;\n\nconst bool isOptRequested = true;\nbool isOptSuccess  = false;\n\nconst bool isStatRequested = false;\nbool isStatSuccess = true;\n\n//////////////////////////////////////////////////////////////////////\n//   NONMEM Specific\n\nconst int nTheta = 7;\n\ndouble c_thetaIn[nTheta] = { 10, -1, 0.05, -0.00001, -0.05, 0.001, -0.000001 };\nconst valarray<double> thetaIn ( c_thetaIn, nTheta );\n\ndouble c_thetaUp[nTheta] = { 100, -0.1, 0.5, -0.000001, -0.005, 0.01, -0.0000001 };\nconst valarray<double> thetaUp  ( c_thetaUp, nTheta );\n\ndouble c_thetaLow[nTheta] = { 1, -10, 0