include \"IndData.h\"\n#include \"DataSet.h\"\n\n#include <spk/multiply.h>\n#include <spk/cholesky.h>\n///////////////////////////////////////////////////////////////////////////////////\n//   NONMEM PRED SPECIFIC\n#include \"Pred.h\"\n#include <spkpred/IndPredModel.h>\n#include <cppad/include/CppAD.h>\n//\n///////////////////////////////////////////////////////////////////////////////////\n\nusing SPK_VA::valarray;\nusing namespace std;\n\nenum RETURN_CODE { SUCCESS=0, CONVERGENCE_FAILURE=1, FILE_ACCESS_FAILURE=2, OTHER_FAILURE };\n\nconst vector<CppAD::AD<double> > wres( int n,\n                                       const valarray<double> & Ri,\n                                       const vector  < CppAD::AD<double> > & residual )\n{\n   assert( Ri.size() == n * n );\n   assert( residual.size() == n );\n   valarray<double> r( n );\n   for( int i=0; i<n; i++ ) r[i] = CppAD::Value( residual[i] );\n   valarray<double> C( 0.0, n * n );\n   C = cholesky( Ri, n );\n   valarray<double> w = multiply( C, n, r, 1 );\n   vector< CppAD::AD<double> > Cr(n);\n   for( int i=0; i<n; i++ ) Cr[i] = w[i];\n   return Cr;\n}\n\nint main( int argc, const char argv[] )\n{\n/*******************************************************************/\n/*                                                                 */\n/*   Set up                                                        */\n/*                                                                 */\n/*******************************************************************/\nofstream oRuntimeError( \"spk_error.tmp\" );\nif( !oRuntimeError.good() )\n  {\n      fprintf( stderr, \"%s:%d: Failed to create a temporary file, %s.\",  __FILE__, __LINE__, \"spk_error.tmp\" );\n      return FILE_ACCESS_FAILURE;\n  }\n\n//FpErrorChecker fperror;\n\nconst int nY = 33;\nDataSet< CppAD::AD<double> > set;\n\nconst bool isSimRequested = false;\nbool haveCompleteData = true;\n\nconst bool isOptRequested = true;\nbool isOptSuccess  = false;\n\nconst bool isStatRequested = false;\nbool isStatSuccess = true;\n\n//////////////////////////////////////////////////////////////////////\n//   NONMEM Specific\n\nconst int nTheta = 5;\n\ndouble c_thetaIn[nTheta] = { 0.5, 1.5, -1, 0.01, 0.02 };\nconst valarray<double> thetaIn ( c_thetaIn, nTheta );\n\ndouble c_thetaUp[nTheta] = { 5, 15, -0.1, 0.1, 0.2 };\nconst valarray<double> thetaUp  ( c_thetaUp, nTheta );\n\ndouble c_thetaLow[nTheta] = { 0.05, 0.15, -10, 0.001, 0.002 };\nconst valarray<double> thetaLow ( c_thetaLow, nTheta );\n\nvalarray<double> thetaStep( nTheta );\n\nvalarray<double> thetaOut( nTheta );\n\nconst int nEta     = 1;\nconst int nOmega   = 1; // #of elements in Omega matrix\nconst int dimOmega = 1; // dimension of Omeaga matrix\ndouble c_omegaIn[nOmega] = { 1 };\nconst valarray<double> omegaIn( c_omegaIn, nOmega );\nvalarray<double> omegaOut( nOmega );\n\n//\n//////////////////////////////////////////////////////////////\n\n//////////////////////////////////////////////////////////////////////\n//   NONMEM PRED Specific\nPred<CppAD::AD<double> > mPred(&set);\nenum IndPredModel::covStruct omegaStruct = IndPredModel::DIAGONAL;\nIndPredModel model( mPred, (int)nTheta, thetaLow, thetaUp, thetaIn, (int)nEta, omegaStruct, omegaIn );\n//\n//////////////////////////////////////////////////////////////////////\n\nconst int nB = model.getNIndPar();\nvalarray<double> bIn  ( nB );\nvalarray<double> bStep( nB );\nvalarray<double> bLow ( nB );\nvalarray<double> bUp  ( nB );\nvalarray<double> bOut ( nB );\ndouble           bObjOut;\nvalarray<double> bObj_bOut( nB );\nvalarray<double> bObj_b_bOut( nB * nB );\n\nconst double eps   = 0.001;\nconst int    mitr  = 450;\nconst int    trace = 1;\nOptimizer    opt( eps, mitr, trace );\n\nmodel.getIndPar       ( bIn );\nmodel.getIndParLimits ( bLow, bUp );\nmodel.getIndParStep   ( bStep );\n\n/*******************************************************************/\n/*                                                                 */\n/*   Data Initialization                                           */\n/*                                                                 */\n/*******************************************************************/\ndouble c_y[] = { 0.844, 0.908, 0.932, 0.936, 0.925, 0.908, 0.881, 0.85, 0.818, 0.784, 0.751, 0.718, 0.685, 0.658, 0.628, 0.603, 0.58, 0.558, 0.538, 0.522, 0.506, 0.49, 0.478, 0.467, 0.457, 0.448, 0.438, 0.431, 0.424, 0.42, 0.414, 0.411, 0.406 };\nvalarray<double> y( c_y, nY );\nhaveCompleteData = true;\n\n/*******************************************************************/\n/*                                                                 */\n/*   Parameter Estimation                                          */\n/*                                                                 */\n/*******************************************************************/\ntimeval optBegin, optEnd;\ndouble optTimeSec = 0.0;\nif( isOptRequested && haveCompleteData )\n{\n  gettimeofday( &optBegin, NULL );\n  try\n  {\n     fitIndividual( model,\n                    y,\n                    opt,\n                    bLow,\n                    bUp,\n                    bIn,\n                    bStep,\n                   &bOut,\n                   &bObjOut,\n                   &bObj_bOut,\n                   &bObj_b_bOut,\n                    false );\n     //FpErrorChecker::check( __LINE__, __FILE__ );\n     isOptSuccess = true;\n  }\n  catch( const SpkException& e )\n  {\n     oRuntimeError << e << endl;\n     cerr << e << endl;\n     isOptSuccess = false;\n     //FpErrorChecker::clear();\n  }\n  catch( ... )\n  {\n     char message[] = \"Unknown exception: failed in parameter estimation!!!\";\n     oRuntimeError << message << endl;\n     cerr << message << endl;\n     isOptSuccess = false;\n     FpErrorChecker::clear();\n  }\n  gettimeofday( &optEnd, NULL );\n  optTimeSec = difftime( optEnd.tv_sec, optBegin.tv_sec );\n\n  //////////////////////////////////////////////////////////////////////\n  //   NONMEM Specific\n  if( isOptSuccess || !isOptSuccess )\n  {\n     valarray<double> ROut( nY * nY );\n     model.getTheta( thetaOut );\n     model.getOmega( omegaOut );\n     model.setIndPar( bOut );\n     model.dataVariance( ROut );\n     for( int j=0; j<nY; j++ )\n        set.data[0]->res[j]  = y[j] - set.data[0]->pred[j];\n     set.data[0]->wres = wres( nY, ROut, set.data[0]->res ); \n  }\n  //\n  //////////////////////////////////////////////////////////////////////\n}\n\n/*******************************************************************/\n/*                                                                 */\n/*   ReportML Document                                             */\n/*                                                                 */\n/*******************************************************************/\nofstream oResults( \"result.xml\" );\nif( !oResults.good() )\n{\n   fprintf( stderr, \"Failed to open a file, %s !!!\", \"result.xml\" );\n   return FILE_ACCESS_FAILURE;\n}\noResults << \"<?xml version=\\\"1.0\\\"?>\" << endl;\noResults << \"<spkreport>\" << endl;\n\nchar buf[ SpkError::maxMessageLen() ];\nifstream iRuntimeError( \"spk_error.tmp\" );\noResults << \"<error_message>\" << endl;\nwhile( iRuntimeError.good() )\n{\n   iRuntimeError.getline(buf, SpkError::maxMessageLen() );\n   oResults << buf << endl;\n}\noResults << \"</error_message>\" << endl;\niRuntimeError.close();\n\nif( !haveCompleteData )\n{\n   oResults << \"</spkreportML>\" << endl;\n   oResults.close();\n   return OTHER_FAILURE;\n}\n\noResults << \"<ind_analysis_result>\" << endl;\n\noResults << \"<ind_opt_result elapsedtime=\\\"\" << optTimeSec << \"\\\">\" << endl;\noResults << \"<ind_obj_out>\" << endl;\noResults << \"<value>\" << bObjOut << \"</value>\" << endl;\noResults << \"</ind_obj_out>\" << endl;\n\n//////////////////////////////////////////////////////////////////////\n//    NONMEM Specific\noResults << \"<theta_out>\" << endl;\nfor( int i=0; i